def weib(x,w1,w2,a1,a2,b1,b2,c1,c2,d1,d2,xo1,xo2):
    func = np.zeros(len(x))
    func += (w1*((((x-xo1)/a1)**b1)*np.exp(-((x-xo1)/c1)**d1)))* (x > xo1)
    func *= (x <= xo2)
    func += (w1*((((x-xo1)/a1)**b1)*np.exp(-((x-xo1)/c1)**d1)) + w2*((((x-xo2)/a2)**b2)*np.exp(-((x-xo2)/c2)**d2))) * (x > xo2)
    return func


